import React, { useContext, useEffect, useState } from "react";
import { Link } from "react-router-dom";

import NotificationDropdown from "components/Dropdowns/NotificationDropdown.js";
import UserDropdown from "components/Dropdowns/UserDropdown.js";
import { AuthContext } from "contexts/AuthContext";
import { useHistory } from "react-router-dom/cjs/react-router-dom";
import { fetchUserData } from "api/api";
import useUserInfo from "api/useUserInfo";

export default function Sidebar() {
  const { logout } = useContext(AuthContext);
  const history = useHistory();
  const [collapseShow, setCollapseShow] = React.useState("hidden");
  const handleLogout = () => {
    logout();
    history.push('/auth/login');
  };
  const userInfo = useUserInfo();

  return (
    <>
      <nav className="md:left-0 md:block md:fixed md:top-0 md:bottom-0 md:overflow-y-auto md:flex-row md:flex-nowrap md:overflow-hidden shadow-xl bg-white flex flex-wrap items-center justify-between relative md:w-64 z-10 py-4 px-6">
        <div className="md:flex-col md:items-stretch md:min-h-full md:flex-nowrap px-0 flex flex-wrap items-center justify-between w-full mx-auto">
          {/* Brand */}
          <h1 className="md:block text-left md:pb-2 text-blueGray-600 mr-0 inline-block whitespace-nowrap text-sm uppercase font-bold p-4 px-0">
            Gestion Cabinet
          </h1>
          {/* User */}
          <ul className="md:hidden items-center flex flex-wrap list-none">
            <li className="inline-block relative">
              <NotificationDropdown />
            </li>
          </ul>
          {userInfo.map((user) => (
            user &&
            user.roles &&
            user.roles.filter((value) => value.roleCode === "ADMIN").length > 0 && (
              <div
                key="admin-sidebar"
                className="md:flex md:flex-col md:items-stretch md:opacity-100 md:relative md:mt-4 md:shadow-none shadow absolute top-0 left-0 right-0 z-40 overflow-y-auto overflow-x-hidden h-auto items-center flex-1 rounded "
              >
                <hr className="my-4 md:min-w-full" />
                <h6 className="md:min-w-full text-blueGray-500 text-xs uppercase font-bold block pt-1 pb-4 no-underline">
                  Catégorie de la secrétaire
                </h6>

                <ul className="md:flex-col md:min-w-full flex flex-col list-none">
                  <li className="items-center">
                    <Link
                      className={
                        "text-xs uppercase py-3 font-bold block " +
                        (window.location.href.indexOf("/admin/dashboard") !== -1
                          ? "text-lightBlue-500 hover:text-lightBlue-600"
                          : "text-blueGray-700 hover:text-blueGray-500")
                      }
                      to="/admin/dashboard"
                    >
                      <i
                        className={
                          "fas fa-tv mr-2 text-sm " +
                          (window.location.href.indexOf("/admin/dashboard") !== -1
                            ? "opacity-75"
                            : "text-blueGray-300")
                        }
                      ></i>{" "}
                      Tableau de bord
                    </Link>
                  </li>

                  <li className="items-center">
                    <Link
                      className={
                        "text-xs uppercase py-3 font-bold block " +
                        (window.location.href.indexOf("/admin/settings") !== -1
                          ? "text-lightBlue-500 hover:text-lightBlue-600"
                          : "text-blueGray-700 hover:text-blueGray-500")
                      }
                      to="/admin/settings"
                    >
                      <i
                        className={
                          "fas fa-tools mr-2 text-sm " +
                          (window.location.href.indexOf("/admin/settings") !== -1
                            ? "opacity-75"
                            : "text-blueGray-300")
                        }
                      ></i>{" "}
                      Settings
                    </Link>
                  </li>

                  <li className="items-center">
                    <Link
                      className={
                        "text-xs uppercase py-3 font-bold block " +
                        (window.location.href.indexOf("/admin/tables") !== -1
                          ? "text-lightBlue-500 hover:text-lightBlue-600"
                          : "text-blueGray-700 hover:text-blueGray-500")
                      }
                      to="/admin/tables"
                    >
                      <i
                        className={
                          "fas fa-table mr-2 text-sm " +
                          (window.location.href.indexOf("/admin/tables") !== -1
                            ? "opacity-75"
                            : "text-blueGray-300")
                        }
                      ></i>{" "}
                      Tables
                    </Link>
                  </li>

                  <li className="items-center">
                    {/* ... Add more links for the admin role if needed ... */}
                  </li>
                </ul>
                <hr className="my-4 md:min-w-full" />
                <button onClick={handleLogout}>Logout</button>
              </div>
            )
          ))}
        </div>
      </nav>
    </>
  );
}
